const MarkerCircle: React.FC<{ x: number; y: number; color: string }> = ({
  x,
  y,
  color,
}) => {
  return <Circle r={20} cx={x} cy={y} color={color} />;
};

const CoordMarkerCircle: React.FC<Coords> = ({ lat, lng }) => {
  const calculatePoint = require("./calcs/point") // only used for debugging
  const { x, y } = calculatePoint({ lat, lng });
  return <MarkerCircle x={x} y={y} color="blue" />;
};

